import Vue from 'vue'
import App from './App.vue'
import router from './router'
import store from './store'
import axios from 'axios'

Vue.config.productionTip = false
//Vue-resouce $http
Vue.prototype.$http=axios;
            //$http.get()=>axios.get()

new Vue({
  router,
  store,
  render: h => h(App)
}).$mount('#app')
